const Skills = () => {
    const skills = [
        {
          category: "Frontend",
          list: ["HTML", "CSS", "Sass", "JavaScript", "React JS", "Typescript"],
        },
        {
          category: "Backend",
          list: ["Python", "Node.js", "Java", "Kotlin", "MySQL", "RESTful APIs"],
        },
        {
          category: "Other Technical Skills",
          list: ["Jetpack Compose", "Confluence", "Jira", "Agile", "Git", "Bash", "Jest", "Swift", "Testing", "Google Cloud", "Google Generative AI"],
        },
        {
          category: "IDEs",
          list: ["Visual Studio", "IntelliJ", "Android Studio"],
        }
      ];

  return (
    <section id="skills" className="bg-gray-100 py-16">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-8 text-center">Skills</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {skills.map((skillCategory) => (
            <div key={skillCategory.category} className="skill-category">
              <h3 className="text-xl font-semibold mb-4">{skillCategory.category}</h3>
              <ul>
                {skillCategory.list.map((skill) => (
                  <li key={skill}>{skill}</li> 
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
